@import './reset.css';
@import './variables.scss';
@mixin mobile {
    @media (min-width: #{$mobile-width}) and (max-width: #{$tablet-width - 1px}) {
        @content;
    }
}

@mixin tablet {
    @media (min-width: #{$tablet-width}) and (max-width: #{$desktop-width - 1px}) {
        @content;
    }
}

@mixin desktop {
    @media (min-width: #{$desktop-width}) {
        @content;
    }
}

.header {
    background-color: #121111;
    display: flex;
    padding: 0 290px;
    @include mobile {
        position: relative;
    }
    @include tablet {
        padding: 0 170px;
    }
    &__logo {
        margin: 0px 34px;
        &__logo-image {
            width: 145px;
            padding: 15px;
            @include mobile {
                width: 136px;
                padding: 35px 0 54px 0;
            }
        }
        @include mobile {
            margin: auto;
        }
        @include tablet {
            display: none;
        }
    }
    &__nav-panel {
        width: 100%;
        display: block;
        &__menu {
            display: flex;
            justify-content: space-between;
            margin: 0 135px;
            height: 100%;
            @include tablet {
                height: initial;
                margin-left: 250px;
                margin-right: 50px;
            }
            &__item {
                color: #fff;
                font-family: "Lato", sans-serif;
                font-size: $menu-item-desktop-font-size;
                height: 100%;
                padding: 0px 15px;
                display: flex;
                align-items: center;
                @include tablet {
                    font-size: $menu-item-tablet-font-size;
                    padding: 54px 15px;
                }
            }
            &__item:hover {
                border-top: 2px solid white;
                background-color: #161515;
                box-sizing: border-box;
                font-weight: 600;
            }
        }
        @include mobile {
            display: none;
        }
    }
    &__log-in {
        display: flex;
        color: #fff;
        margin-right: 80px;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        @include mobile {
            display: none;
        }
        @include tablet {
            margin-right: 33px;
        }
        &__image {
            padding: 0 10px;
        }
    }
    &__log-in:hover {
        cursor: pointer;
    }
    &__register {
        display: flex;
        color: #fff;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        @include mobile {
            display: none;
        }
    }
    &__register:hover {
        cursor: pointer;
    }
    &__menu-burger {
        display: none;
        @include mobile {
            display: block;
            position: absolute;
            right: 7%;
            top: 32%;
        }
        &__image {
            width: $menu-burger-image-size;
        }
    }
}

.heading-section {
    background: url("../images/first-section-background.jpg") no-repeat top center;
    overflow-x: hidden;
    position: relative;
    background-size: cover;
    &__summary {
        color: white;
        font-family: 'Lato';
        margin: 0 260px;
        padding: 362px 0px;
        text-align: center;
        width: 50%;
        @include mobile {
            padding: 193px 0px 90px 0;
            width: 100%;
            margin: auto;
        }
        @include tablet {
            margin: 0px 173px;
            padding: 232px 0px;
        }
        &__header {
            font-size: $main-header-font-size-desktop;
            font-weight: 600;
            @include mobile {
                font-size: $main-header-font-size-mobile;
            }
            @include tablet {
                font-size: $main-header-font-size-tablet;
            }
        }
        &__text {
            font-size: $heading-text-font-size-desktop;
            margin-top: 48px;
            @include mobile {
                font-size: $heading-text-font-size-mobile;
                margin-top: 26px;
            }
            @include tablet {
                font-size: $heading-text-font-size-tablet;
                margin-top: 30px;
            }
        }
    }
    &__borderline {
        display: flex;
        justify-content: flex-end;
        margin-top: 24px;
        @include mobile {
            margin-top: 10px;
        }
        @include tablet {
            margin-top: 12px;
        }
    }
    &__borderline--small {
        height: 10px;
        width: 10px;
        background-color: white;
        border-radius: 50%;
        margin-right: 22px;
        @include mobile {
            height: 8px;
            margin-right: 14px;
        }
        @include tablet {
            height: 8px;
            width: 9px;
        }
    }
    &__borderline--middle {
        height: 10px;
        width: 19px;
        background-color: white;
        border-radius: 5px;
        margin-right: 11px;
        @include mobile {
            margin-right: 11px;
            height: 8px;
            width: 16px;
        }
        @include tablet {
            height: 8px;
            width: 15px;
            margin-right: 8px;
        }
    }
    &__borderline--big {
        height: 10px;
        width: 345px;
        background-color: white;
        border-radius: 5px;
        @include mobile {
            height: 8px;
            width: 232px;
            margin-right: 9%;
        }
        @include tablet {
            height: 8px;
            width: 218px;
        }
    }
    &__list-of-buttons {
        display: flex;
        justify-content: center;
        margin-top: 250px;
        @include mobile {
            margin-top: 90px;
        }
        @include tablet {
            margin-top: 163px;
        }
        &__merged {
            display: flex;
            margin-left: 55px;
        }
    }
    &__btn {
        background-color: transparent;
        color: white;
        border: 1px solid white;
        padding: 0.6em 0.7em;
        font-size: $header-btn-font-size-desktop;
        @include mobile {
            font-size: $header-btn-font-size-mobile;
        }
        @include tablet {
            font-size: $header-btn-font-size-tablet;
        }
    }
    &__btn:hover {
        background-color: #e8e9ea;
        color: #318da4;
    }
    &__iphone-image {
        position: absolute;
        right: 273px;
        bottom: 0;
        display: block;
        @include mobile {
            display: none;
        }
        @include tablet {
            right: 170px;
        }
        &__image {
            width: $iphone-image-desktop-size;
            @include tablet {
                width: $iphone-image-tablet-size;
            }
        }
    }
}
